  q_0: ┤0              ├┤m├───┤0            ├┤0         ├┤m├───
       │  my_gate(2*a) │└╥┘┌─┐│             ││          │└╥┘┌─┐
  q_1: ┤1              ├─╫─┤m├┤1            ├┤1         ├─╫─┤m├
       └──────┬─┬──────┘ ║ └╥┘│             ││  if_else │ ║ └╥┘
  q_2: ───────┤m├────────╫──╫─┤  while_loop ├┤          ├─╫──╫─
              └╥┘        ║  ║ │             ││          │ ║  ║
mid_0: ════════╬═════════╩══╬═╡1            ╞╡0         ╞═╬══╬═
               ║            ║ │             │└──────────┘ ║  ║
mid_1: ════════╬════════════╩═╡0            ╞═════════════╬══╬═
               ║              └─────────────┘             ║  ║
